/*
@page {
    size: 29.7cm 21cm;
    margin: 5mm 5mm 5mm 5mm;
}
*/

@media print {
  a:link:after,
  a:visited:after {
      content: "" !important;
  }
  .even {
      background-color: WhiteSmoke !important;
  }
  .odd {
      background-color: white !important;
  }

  .pagebreak {
    page-break-before: always;
  }
}

body{
    margin-left: 0.2em;
    margin-right: 0.2em;
    margin-top: 0.2em;
    margin-bottom: 0.2em;
    font-family: 'Exo', sans-serif;
    color: black;
}
h1,h2,h3{
    text-align: center;
}
img {
    height: 10em;
}
table.main {
    width: 100%;
}

table.main tr td, table.main tr th {
    page-break-inside: avoid;
}

.borderBottom {
    border-bottom: 1px black solid;
}

table.secondary tr {
    border: 0;
}
td, th {
    text-overflow: ellipsis;
    vertical-align: middle;
    padding: 0.5em;
}
table.secondary td {
    margin: 0;
    padding: 0.1em;
}

.noborder2 {
    border: 0;
}

.center {
    text-align: center;
}

.even {
    background-color: WhiteSmoke;
}
.odd {
    background-color: white;
}
ul.nobullets {
  list-style-type: none; /* Remove bullets */
  padding: 0; /* Remove padding */
  margin: 0; /* Remove margins */
}
ul.nobullet {
  list-style-type: none; /* Remove bullets */
  padding-left: 0; /* Remove padding */
  margin-left: 0; /* Remove margins */
}
.italic {
    font-style: italic;
}
    </style>
